document.addEventListener("DOMContentLoaded", function () {
    var canvas = document.getElementById("game");
    var ctx = canvas.getContext('2d');
    var ch = canvas.height;
    var cw = canvas.width;
    var wh = ch / 2;
    var ww = cw / 2;
    // testing
    // hypo lines
    ctx.beginPath();
    ctx.moveTo(0, 0);
    ctx.lineTo(cw, ch);
    ctx.stroke();
    ctx.beginPath();
    ctx.moveTo(cw, 0);
    ctx.lineTo(0, ch);
    ctx.stroke();
    // far wall square
    ctx.beginPath();
    ctx.rect(ww / 2, wh / 2, ww, wh);
    ctx.stroke();
    // ball
    ctx.beginPath();
    ctx.moveTo(cw / 2, ch / 2); //centered
    ctx.arc(cw / 2, ch / 2, cw / 8, 0, Math.PI * 2);
    ctx.fillStyle = "blue";
    ctx.fill();
});

